"""

You are given an integer array nums consisting of n elements, 
and an integer k.

Find a contiguous subarray whose length is equal to k that has 
the maximum average value and return this value. Any answer 
with a calculation error less than 10-5 will be accepted.
"""

from typing import List


class Solution:
    def findMaxAverage(self, nums: List[int], k: int) -> float:
        
        ### too slow
        # maxAvg = sum(nums[0:k])/k
        # for i in range(0, len(nums) - (k-1), 1):
        #     maxAvg = max((sum(nums[i:i+k])/k), maxAvg)

        # return maxAvg


        ### still too damn slow
        # maxAvg = sum(nums[0:k])/k
        # movSum = sum(nums[0:(k-1)])
        # for i in range(0, len(nums) - (k-1), 1):
        #     movSum += nums[i:i+k][-1]
        #     if (movSum/k) > maxAvg:
        #         maxAvg = movSum/k
        #     # maxAvg = max(movSum/k, maxAvg)
        #     movSum -= nums[i:i+k][0]

        # return maxAvg

        ### higher average means higher sum, get it first
        maxSum = sum(nums[0:k])
        movSum = maxSum
        for i in range(k, len(nums)):
            movSum += nums[i] - nums[i-k]
            if (movSum) > maxSum:
                maxSum = movSum
            

        return maxSum/k

sth = Solution()
